    browser.pause(2000);
  }

  selectCountyDropdownalue() {
    this.selectCounty.waitForDisplayed({
      timeout: 30000
    });
    this.selectCounty.$$('li')[5].click();
    browser.pause(3000);
  }

  clickOnAdd() {
    this.addButton.waitForDisplayed({
      timeout: 30000
    });
    this.addButton.click();
    browser.pause(1000);
  }

}

module.exports = new LicenseHomePage();
